import React from 'react';
import './Weather.css'; // Import the CSS file

function Weather() {
  return (
    <section id="weather">
      <h1>Weekly Weather Forecast</h1>
      <div id="wwo-weather-widget-1"></div>
      <script
        type="text/javascript"
        src="https://www.worldweatheronline.com/widget/v5/weather-widget.ashx?loc=133269&wid=1&tu=1&div=wwo-weather-widget-1"
        async
      ></script>
      <noscript>
        <a href="https://www.worldweatheronline.com/melbourne-weather/victoria/au.aspx" alt="Hour by hour Melbourne, Victoria weather">
          Melbourne, Victoria weather forecast hourly
        </a>
      </noscript>
    </section>
  );
}

export default Weather;
